import React from 'react';
import './Section.css';

const Section = () => {
    return (
        <div className='section'>
            <p>Gooder™ is a new way of good-doing. Expand your community help while connecting & socializing with people from all over the world. 
                Whether you need something or have something to offer - Gooder™ will open a new world of opportunities. Make your life better 
                or change someone's life within a second - It's all up to you.</p>
        </div>
    );
};

export default Section;
